import './Dashboard.css';
import { useState } from 'react';
import { Link, Route } from 'react-router-dom';

import NavBar from '../NavBar/NavBar';

function Dashboard() {
    return (
        <div className='Dashboard'>
            <NavBar />
            <p1> Discover Experiences </p1>
        </div>
    );
}

export default Dashboard;
